import React,{ Component } from "react"
import { Navbar, Nav } from 'react-bootstrap';

class DashBoard extends Component{
    render(){
        return(
            <Navbar bg="light" expand="lg">
                <Navbar.Brand href="/">Smart Grid System</Navbar.Brand>
                <Navbar.Toggle aria-controls="basic-navbar-nav" />
                <Navbar.Collapse id="basic-navbar-nav">
                    <Nav className="mr-auto">
                        {/* <Nav.Link href="/home">Grid Navigation</Nav.Link>
                        <Nav.Link href="/enegrybalance">Device Details</Nav.Link> */}
                        <ul className="navbar-nav mr-auto">
                            <li><Link to={'/topology'} className="nav-link"> Grid Navigation </Link></li>
                            <li><Link to={'/energybalance'} className="nav-link">Device Details</Link></li>
                        </ul>
                    </Nav>
                    <Switch>
                        <Route exact path='/topology' component={RangeBarChart} />
                        <Route exact path ='/energybalance' component={LineChart}/>
                        <Route exact path ='/voltage' component={VoltageChart}/>
                        <Route exact path ='/loadprofile' component={LPDT}/>
                        <Route exact path ='/events' component={Events}/>
                    </Switch>
                </Navbar.Collapse>
            </Navbar>
        )
    }
}

export default DashBoard;
